import './App.css';
import React from "react";

import { BrowserRouter, Route } from "react-router-dom";



function App() {
  return (
    <React.Fragment>
      <BrowserRouter>
        <Route path="/" exact></Route>
      </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
